import { Button } from '@mui/material'
import React from 'react'
import './Banner.css'
import TypeWriterEffect from 'react-typewriter-effect';


function Banner() {
  return (
    <div className='banner'>
        <div className='banner_info'>
        <TypeWriterEffect
            textStyle={{ fontFamily: 'Red Hat Display',fontSize:"6" }}
            startDelay={100}
            cursorColor="black"
            text="Your all-in-one home maintenance professionals"
            typeSpeed={100}

          />
            <h1>Your all-in-one home maintenance professionals</h1>
            <h4>We fix things around your house so you don't have to.</h4>
            <h5>Quality repair, fair pricing</h5>
            <Button variant='outline'>Call us Now</Button>
        </div>
    </div>
  )
}

export default Banner
